import React from 'react';
import styled from 'styled-components';

export default function Search() {
  return (
    <div className='d-flex m-0 p-0 text-left' style={{ width: '35%' }}>
      <form action='' className='container-fluid bg-white'>
        <div className='input-group d-inline-flex w-100 input-sm'>
          <StyledInput>
            <input
              type='text'
              placeholder='Search for products, brands and more'
              className='form-control input-group-text rounded-0 bg-white border-0
            px-3 placeholder-sm'
            />
          </StyledInput>
          <button className='input-group-text rounded-0 bg-white border-0'>
            <i className='fa-solid fa-magnifying-glass border-0' />
          </button>
        </div>
      </form>
    </div>
  );
}

const StyledInput = styled.div`
  input {
    font-size: 5px;
  }
`;
